import { ButtonGroup, Typography } from "@mui/material";
import Button from '@mui/material/Button';
import { Box, padding } from "@mui/system";
import React from "react";

const NavBarStyle = {
//   backgroundColor: "red",
  height: 50,
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  padding: "0 60px 0 60px",
};

const NavBarMenuStyle = {
//   backgroundColor: "green",
  display: "flex",
  justifyContent: "space-between",
  width: "100%",
};

const NavBarMenuListStyle = {
  display: "flex",
  justifyContent: "space-between",
  alignItems: "center",
//   backgroundColor: "yellow",
  width: "500px",
};

const MetaEduTypo = {
  fontWeight: "bold",
  fontSize: 25,
};

const HelloEduTypo = {
    fontWeight: "bold",
}

const MetaEduStyle = {
    display: 'flex',
    alignItems: 'center'
}

const HelloEduStyle = {
    display: 'flex',
    alignItems: 'center',
    backgroundColor: 'black',
    color: 'white',
    padding: '10px 20px 10px 20px',
    borderRadius: '50px'
}

export default function NavigationBar() {
  return (
    <Box sx={NavBarStyle}>
      <Box sx={NavBarMenuStyle}>
        <Box sx={MetaEduStyle}>
          <Box>
            <Typography sx={MetaEduTypo}>MetaEducation</Typography>
          </Box>
        </Box>
        <Box sx={NavBarMenuListStyle}>
          <Box>
            <Typography>Home</Typography>
          </Box>
          <Box>
            <Typography>Profile</Typography>
          </Box>
          <Box>
            <Typography>Product</Typography>
          </Box>
          <Box>
            <Typography>Collab</Typography>
          </Box>
        </Box>
        <Box sx={HelloEduStyle}>
          <Typography sx={HelloEduTypo}>Hello Educationers!</Typography>
        </Box>
      </Box>

    </Box>
  );
}
